import {
  Form,
  Select,
  InputNumber,
  DatePicker,
  Switch,
  Slider,
  Button,
} from "antd";
const FormItem = Form.Item;

function headerCovid() {
  return (
    <FormItem>
      <div className="nu-font-covid">
        <div>
          <div
            style={{
              display: "flex",
              flexDirection: "row",
              width: "100%",
              height: "100%",
            }}
          >
            <div
              style={{
                textAlign: "left",
                display: "flex",
                width: "100%",
                background: "green",
                justifyContent: "flex-start",
                alignItems: "center",
              }}
            >
              <Button style={{height:"42px",fontSize:"22px",marginLeft:"20px"}} type="primary">ย้อนกลับ</Button>
            </div>

            <div
              style={{
                textAlign: "left",
                display: "flex",
                width: "100%",
                flexDirection: "column",
              }}
            >
              <div
                style={{
                  display: "flex",
                  background: "red",
                  justifyContent: "flex-end",
                  textAlign: "right",
                }}
              >
                <h1 style={{ color: "white" }}>แบบประเมิน COVID 19</h1>
              </div>
              <div
                style={{
                  display: "flex",
                  background: "blue",
                  justifyContent: "flex-end",
                  textAlign: "right",
                }}
              >
                <h2 style={{ color: "white" }}>
                  แบบประเมินสงสัยโรคติดเชื้อไวรัสโคโรนาสายพันธุ์ใหม่ 2019
                  (COVIDE 19)
                </h2>
              </div>
            </div>
          </div>
        </div>
      </div>
    </FormItem>
  );
}
export default headerCovid;
